import { useState } from 'react'

const DegreeFilterOption = ({text}) => {

    const [isPicked, setIsPicked] = useState(false);

    return (
        <div>
            <Button onClick={setIsPicked(!isPicked)}>{text}</Button>
        </div>
    )
}

export default DegreeFilterOption
